// import { Menu } from '@mui/material';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Menu from './components/Menu';
import Home from './components/Home';
import Login from './components/Login';
import Register from './components/Register';
import Profile from './components/Profile';
import Tasks from './components/Tasks';
import { MenuItem } from '@mui/material';


function App() {
  return (
    <Router>
    <div>
      <Menu />
      <Routes>
        <MenuItem><Route exact path="/" component={Home} /></MenuItem>
        <MenuItem><Route path="/login" component={Login} /> </MenuItem>
        <MenuItem><Route path="/register" component={Register} /></MenuItem>
        <MenuItem><Route path="/profile" component={Profile} /></MenuItem>
        <MenuItem><Route path="/tasks" component={Tasks} /></MenuItem>
        </Routes>
    </div>
  </Router>
  );
}

export default App;
